    <p>{`Find details here for the configuration properties that you can use when running LiveData Migrator as a system service. Properties are defined in the `}<inlineCode parentName="p">{`/etc/wandisco/live-migrator/application.properties`}</inlineCode>{` file. Each configuration property can also be provided to LiveData Migrator as a command-line argument when launched, e.g. `}<inlineCode parentName="p">{`--server.port=19999`}</inlineCode>{`.`}</p>
    <p>{`An example `}<inlineCode parentName="p">{`application.properties`}</inlineCode>{` file:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-text"
      }}>{`# pretty print JSON output in API results
spring.jackson.serialization.INDENT_OUTPUT=true
springdoc.swagger-ui.path=/lm2-api.html
# spring.main.lazy-initialization = true
pull.threads=50
engine.threads=1000
persisted.store=true
server.port=18080
shell.history.filePath=~/.livemigrator_history
cli.enabled=true
ssh.shell.enable=true
ssh.shell.prompt.local.enable=\${cli.enabled}
spring.shell.interactive.enabled=\${cli.enabled}

# prevayler configuration
install.dir=
prevayler.databaseLocation=\${install.dir}db
prevayler.persistent=true
prevayler.force=true
prevayler.bufferedJournal=true
prevayler.mirrored=true

# security configuration for basic authentication
security.type=off
#security.type=basic
#security.basic.user=admin
#security.basic.password={bcrypt}$2a$10$kXzfqwiiCY/ZW9e9BboNmuIbe5xe2kNjdk1YNUxmsCaQ7PlBLCe4W
adls1.fs.type.default.properties=fs.scheme,fs.account.name,fs.container.name,fs.auth.type,fs.oauth2.client.id
adls2.fs.type.default.properties=fs.scheme,fs.account.name,fs.container.name,fs.auth.type,fs.oauth2.client.id
hdfs.fs.type.default.properties=fs.defaultFS
s3a.fs.type.default.properties=fs.defaultFS
local.fs.type.default.properties=fs.root

lm.kerberos.is.enabled=false
#lm.kerberos.principal=hdfs-dmagen-02@WANDISCO.HADOOP
#lm.kerberos.keytab.location=/etc/security/keytabs/hdfs.headless.keytab
lm.kerberos.principal=
lm.kerberos.keytab.location=

# HTTP traffic logging config
logging.level.org.zalando.logbook=TRACE
logbook.format.style=http
logbook.write.max-body-size=1024
logbook.exclude=/v3/api-docs/**,/swagger-ui/**
# HTTP message masking properties
#logbook.obfuscate.parameters=access_token,password
#logbook.obfuscate.headers=authorization,x-auth-password,x-auth-token,X-Secret
#obfuscate.json.properties=foo,bar

ssh.shell.prompt.text=WANdisco LiveMigrator >>\\u0020
ssh.shell.prompt.color=white
ssh.shell.authentication=simple
ssh.shell.user=user
ssh.shell.password=password
ssh.shell.port=2222
ssh.shell.historyFile=\${user.home}/.livemigrator_history
#ssh.shell.authorized-public-keys-file=samples/public-keys-sample
`}</code></pre>
    <h2 {...{
      "id": "general-configuration"
    }}>{`General configuration`}</h2>
    <p>{`These configuration properties are used to adjust general items of operation.`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Name`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Details`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`spring.jackson.serialization.INDENT_OUTPUT`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Whether to apply indentation to JSON output from command results`}<br /><br /><strong parentName="td">{`Default value`}</strong>{`: `}<inlineCode parentName="td">{`true`}</inlineCode><br /><strong parentName="td">{`Allowed values`}</strong>{`: `}<inlineCode parentName="td">{`true`}</inlineCode>{`, `}<inlineCode parentName="td">{`false`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`springdoc.swagger-ui.path`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`The path at which clients can access the Swagger documentation for the LiveData Migrator REST API`}<br /><br /><strong parentName="td">{`Default value`}</strong>{`: `}<inlineCode parentName="td">{`/lm2-api.html`}</inlineCode><br /><strong parentName="td">{`Allowed values`}</strong>{`: Any valid file path`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`pull.threads`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`The size of the thread pool that is used for executing activities related to notifications of changes in an HDFS environment`}<br /><br /><strong parentName="td">{`Default value`}</strong>{`: `}<inlineCode parentName="td">{`50`}</inlineCode><br /><strong parentName="td">{`Allowed values`}</strong>{`: An integer value between `}<inlineCode parentName="td">{`1`}</inlineCode>{` and `}<inlineCode parentName="td">{`10000`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`engine.threads`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`The size of the thread pool used to perform migration of content from the source file system to targets`}<br /><br /><strong parentName="td">{`Default value`}</strong>{`: `}<inlineCode parentName="td">{`1000`}</inlineCode><br /><strong parentName="td">{`Allowed values`}</strong>{`: An integer value between `}<inlineCode parentName="td">{`1`}</inlineCode>{` and `}<inlineCode parentName="td">{`10000`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`persisted.store`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Reserved for future use`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`server.port`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`The TCP port used to listen for clients interacting with the `}<a parentName="td" {...{
              "href": "/docs/api-reference"
            }}>{`REST API`}</a><br /><br /><strong parentName="td">{`Default value`}</strong>{`: `}<inlineCode parentName="td">{`18080`}</inlineCode><br /><strong parentName="td">{`Allowed values`}</strong>{`: An integer value between `}<inlineCode parentName="td">{`1024`}</inlineCode>{` and `}<inlineCode parentName="td">{`65535`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`shell.history.filePath`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Location of the record of commands issued at the action prompt`}<br /><br /><strong parentName="td">{`Default value`}</strong>{`: `}<inlineCode parentName="td">{`~/.livemigrator_history`}</inlineCode><br /><strong parentName="td">{`Allowed values`}</strong>{`: The full path to a valid filename in a directory that is writable by the user running LiveData Migrator (typically `}<inlineCode parentName="td">{`hdfs`}</inlineCode>{`.)`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`cli.enabled`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Whether the action prompt interface will be made available from the LiveData Migrator instance`}<br /><br /><strong parentName="td">{`Default value`}</strong>{`: `}<inlineCode parentName="td">{`true`}</inlineCode><br /><strong parentName="td">{`Allowed values`}</strong>{`: `}<inlineCode parentName="td">{`true`}</inlineCode>{`, `}<inlineCode parentName="td">{`false`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`spring.shell.interactive.enabled`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Whether the console session with the action prompt is interactive or non-interactive, affecting prompt output, command completino and other interactive features`}<br /><br /><strong parentName="td">{`Default value`}</strong>{`: `}<inlineCode parentName="td">{`true`}</inlineCode><br /><strong parentName="td">{`Allowed values`}</strong>{`: `}<inlineCode parentName="td">{`true`}</inlineCode>{`, `}<inlineCode parentName="td">{`false`}</inlineCode></td>
        </tr>
      </tbody>
    </table>
    <h2 {...{
      "id": "ssh-access"
    }}>{`SSH access`}</h2>
    <p>{`These configuration properties govern whether and how access to LiveData Migrator is provided using the `}<a parentName="p" {...{
        "href": "https://en.wikipedia.org/wiki/Secure_Shell"
      }}>{`SSH protocol`}</a>{`. You can manage LiveData Migrator when it operates as a system service using either the `}<a parentName="p" {...{
        "href": "/docs/api-reference"
      }}>{`REST API`}</a>{`, or using SSH access to the console interface.`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Name`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Details`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`ssh.shell.enable`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Whether LiveData Migrator will accept connections from an SSH client to provide access to the action prompt. Setting this to false will prevent access via SSH from any client.`}<br /><br /><strong parentName="td">{`Default value`}</strong>{`: `}<inlineCode parentName="td">{`true`}</inlineCode><br /><strong parentName="td">{`Allowed values`}</strong>{`: `}<inlineCode parentName="td">{`true`}</inlineCode>{`, `}<inlineCode parentName="td">{`false`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`ssh.shell.prompt.local.enable`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Whether LiveData Migrator will allow local access via SSH to the action prompt. Setting this to `}<inlineCode parentName="td">{`false`}</inlineCode>{` will prevent access from local clients.`}<br /><br /><strong parentName="td">{`Default value`}</strong>{`: `}<inlineCode parentName="td">{`true`}</inlineCode><br /><strong parentName="td">{`Allowed values`}</strong>{`: `}<inlineCode parentName="td">{`true`}</inlineCode>{`, `}<inlineCode parentName="td">{`false`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`ssh.shell.prompt.text`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`This is the text content presented as the action prompt. You can override it to provide instance-specific text.`}<br /><br /><strong parentName="td">{`Default value`}</strong>{`: `}<inlineCode parentName="td">{`WANdisco LiveMigrator >>\\u0020`}</inlineCode><br /><strong parentName="td">{`Allowed values`}</strong>{`: Any text string`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`ssh.shell.prompt.color`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`The color used for the action prompt. `}<br /><br /><strong parentName="td">{`Default value`}</strong>{`: `}<inlineCode parentName="td">{`white`}</inlineCode><br /><strong parentName="td">{`Allowed values`}</strong>{`: One of the color names `}<inlineCode parentName="td">{`black`}</inlineCode>{`, `}<inlineCode parentName="td">{`white`}</inlineCode>{`, `}<inlineCode parentName="td">{`red`}</inlineCode>{`,`}<inlineCode parentName="td">{`yellow`}</inlineCode>{`, `}<inlineCode parentName="td">{`green`}</inlineCode>{`, `}<inlineCode parentName="td">{`blue`}</inlineCode>{`.`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`ssh.shell.authentication`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Defines the authentication mechanism used by LiveData Migrator for SSH access. `}<inlineCode parentName="td">{`simple`}</inlineCode>{` denotes authentication provided by the username and password defined in the `}<inlineCode parentName="td">{`ssh.shell.user`}</inlineCode>{` and `}<inlineCode parentName="td">{`ssh.shell.password`}</inlineCode>{` configuration properties, while `}<inlineCode parentName="td">{`security`}</inlineCode>{` denotes authentication using a private key that matches one of the public keys in the file specified with the `}<inlineCode parentName="td">{`ssh.shell.authorized-public-keys-file`}</inlineCode>{` configuration property.`}<br /><br /><strong parentName="td">{`Default value`}</strong>{`: `}<inlineCode parentName="td">{`simple`}</inlineCode><br /><strong parentName="td">{`Allowed values`}</strong>{`: `}<inlineCode parentName="td">{`simple`}</inlineCode>{`, `}<inlineCode parentName="td">{`security`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`ssh.shell.user`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`The username that an SSH client must provide when LiveData Migrator is configured for simple authentication.`}<br /><br /><strong parentName="td">{`Default value`}</strong>{`: `}<inlineCode parentName="td">{`user`}</inlineCode><br /><strong parentName="td">{`Allowed values`}</strong>{`: Any string that defines a username (no whitespace)`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`ssh.shell.password`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`The password that an SSH client must provide when LiveData Migrator is configured to use simple authentication.`}<br /><br /><strong parentName="td">{`Default value`}</strong>{`: `}<inlineCode parentName="td">{`password`}</inlineCode><br /><strong parentName="td">{`Allowed values`}</strong>{`: Any string`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`ssh.shell.port`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`The TCP port on which LiveData Migrator will listen for new SSH connections`}<br /><br /><strong parentName="td">{`Default value`}</strong>{`: `}<inlineCode parentName="td">{`2222`}</inlineCode><br /><strong parentName="td">{`Allowed values`}</strong>{`: An integer value between `}<inlineCode parentName="td">{`1024`}</inlineCode>{` and `}<inlineCode parentName="td">{`65535`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`ssh.shell.historyFile`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`The full path to the file in which the record of commands issued to the action prompt will be recorded`}<br /><br /><strong parentName="td">{`Default value`}</strong>{`: `}<inlineCode parentName="td">{`\${user.home}/.livemigrator_history`}</inlineCode><br /><strong parentName="td">{`Allowed values`}</strong>{`: The full path to a valid filename in a directory that is writable by the user running LiveData Migrator (typically `}<inlineCode parentName="td">{`hdfs`}</inlineCode>{`.)`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`ssh.shell.authorized-public-keys-file`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`The file containing public keys against which client credentials will be matched to authorize access to the console over SSH when LiveData Migrator is configured for `}<inlineCode parentName="td">{`security`}</inlineCode>{` authentication`}<br /><br /><strong parentName="td">{`Default value`}</strong>{`: `}<inlineCode parentName="td">{`samples/public-keys-sample`}</inlineCode><br /><strong parentName="td">{`Allowed values`}</strong>{`: The full path to a file that contains one line entry per public key, in the same format used by `}<inlineCode parentName="td">{`sshd`}</inlineCode>{`.`}</td>
        </tr>
      </tbody>
    </table>
    <h2 {...{
      "id": "logging"
    }}>{`Logging`}</h2>
    <p>{`Configure how LiveData Migrator logs requests made against the `}<a parentName="p" {...{
        "href": "/docs/api-reference"
      }}>{`REST API`}</a>{`.`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Name`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Details`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`logging.level.org.zalando.logbook`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`The logging level to apply to HTTP activity against the REST API of LiveData Migrator. This must be set to `}<inlineCode parentName="td">{`TRACE`}</inlineCode>{` to record any log information.`}<br /><br /><strong parentName="td">{`Default value`}</strong>{`: `}<inlineCode parentName="td">{`TRACE`}</inlineCode><br /><strong parentName="td">{`Allowed values`}</strong>{`: `}<inlineCode parentName="td">{`TRACE`}</inlineCode>{`, `}<inlineCode parentName="td">{`NONE`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`logbook.format.style`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`The logging style applied to HTTP activity records`}<br /><br /><strong parentName="td">{`Default value`}</strong>{`: `}<inlineCode parentName="td">{`http`}</inlineCode><br /><strong parentName="td">{`Allowed values`}</strong>{`: `}<inlineCode parentName="td">{`http`}</inlineCode>{`, `}<inlineCode parentName="td">{`curl`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`logbook.write.max-body-size`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`The maximum number of bytes from an HTTP request or response body to include in a log entry`}<br /><br /><strong parentName="td">{`Default value`}</strong>{`: 1024`}<br /><strong parentName="td">{`Allowed values`}</strong>{`: Any integer between `}<inlineCode parentName="td">{`1`}</inlineCode>{` and `}<inlineCode parentName="td">{`2147483647`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`logbook.exclude`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`A comma-separated list of patterns that match URIs for which HTTP activity should not be logged`}<br /><br /><strong parentName="td">{`Default value`}</strong>{`: `}<inlineCode parentName="td">{`/v3/api-docs/**,/swagger-ui/**`}</inlineCode><br /><strong parentName="td">{`Allowed values`}</strong>{`: Any valid comma-separated list of patterns`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`logbook.obfuscate.parameters`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`A comma-separated list of HTTP parameters that should not be recorded in log entries, e.g. `}<inlineCode parentName="td">{`access_token,password`}</inlineCode><br /><br /><strong parentName="td">{`Default value`}</strong>{`: (none)`}<br /><strong parentName="td">{`Allowed values`}</strong>{`: Any valid comma-separated list of HTTP parameter names`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`logbook.obfuscate.headers`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`A comma-separated list of HTTP headers that should not be recorded in log entries, e.g. `}<inlineCode parentName="td">{`authorization,x-auth-password,x-auth-token,X-Secret`}</inlineCode><br /><br /><strong parentName="td">{`Default value`}</strong>{`: (none)`}<br /><strong parentName="td">{`Allowed values`}</strong>{`: Any valid comma-separated list of HTTP headers`}</td>
